[MPDocument]
sotGrp_PROGRAM=프로그램 그룹에는 작은 프로그램 관련 헤더 파일, 소스 코드 및 문서가 포함되어 있습니다.
sotGrp_VARS=변수 그룹에는 애플릿에 정의 된 시스템 -레벨 변수가 포함되어 있습니다. 외부 인터페이스와 상호 작용할 수 있습니다. <br> 플로팅 -Point "V1"변수를 정의한 후 다음 작업은 변수에 사용할 수 있습니다. <br> [1. ] 변수 값 읽기 : Double d
sotGrp_TIMERS=타이머 그룹에는 애플릿에 정의 된 모든 타이머가 포함되어 있습니다. 다음 예제를 사용하여 타이머를 사용하십시오. <br> [1] "Tim1"<br> [2]와 같은이 그룹의 타이머를 정의하십시오. "이벤트의 타이머"에서 그룹에서 "ontim1"과 같은 타이머 콜백 함수를 정의하고, 코드 ()에 타이머를 사용하기 전에 <br> [4] 이전에 정의 된 타이머와 연결합니다. Br> [5] Timer Callback 함수 "OnTIM1"앞에서 정의 된 The Cycle Call로 10ms라고합니다.
sotGrp_ON_CAN_RXS=CAN 수신 이벤트 그룹에는 모든 정의된 CAN / CAN FD 메시지 수신 콜백 함수가 포함되어 있습니다. 콜백 방법은 다음과 같습니다：<BR>[1] 그룹 내에서 "OnRx123"라는 콜백 함수를 정의하고 속성을 식별자 "0x123"에 바인딩합니다. 이것은 ID를 수신했음을 나타냅니다.
sotGrp_ON_CAN_TXS=CAN Sending Event 그룹에는 성공적인 복구 기능을 보내기 위해 정의 된 모든 CAN / CAN FD 패킷이 포함되어 있습니다. <br> 참고 : 성공적인 메시지를 보내는 것만 (다른 노드가 성공적으로 응답)이 콜백에 들어갑니다. <br> TSMaster가 지원하는 하드웨어 중 동일한 스타 시리즈, 벡터 풀 시리즈 및 올바른 패킷을 생성 할 수있는 기능 하드웨어 타임 스탬프 <br> 다른 브랜드의 하드웨어를 사용할 때 성공 여부에 관계없이 타협으로 강제로 호출됩니다. <br> adoback 메소드는 다음과 같습니다. <br> [1] 콜백 함수 이름 "ONTX123"및 그 속성 바인딩 로고 "0x123", <br> 이는 성공적인 전송을 나타냅니다.
sotGrp_ON_CAN_PRETXS=CAN 사전 발행 이벤트 그룹에는 이전 콜백 기능을 보내기 전에 정의 된 모든 CAN / CAN FD 패킷이 포함되어 있습니다. <br> 참고 :이 기능은 TSMaster에 고유하며 시스템은 각 패킷의 프레임이 이러한 기능으로 연결될 수 있습니다. <br> 패킷이나 프레임 유형의 내용을 수정하려면이 기능을 사용하는 것이 매우 유용합니다. <br>이 기능의 개입이 매우 높기 때문에 사용할 때 데이터를 식별하고 보호하는 데주의를 기울이십시오. <br> adoback 메소드는 다음과 같습니다. <br> [1] 콜백 함수 이름 "onpretx123", 그 속성 바인딩 로고 "0x123", <br> 이는 ID가 TSMaster의 모든 창에서 ID로 전송되었음을 의미합니다. .
sotGrp_ON_LIN_RXS=LIN 수신 이벤트 그룹에는 모든 정의된 LIN 메시지 수신 콜백 함수가 포함되어 있습니다. 콜백 방법은 다음과 같습니다：<BR>[1] 그룹 내에서 "OnRx12"라는 콜백 함수를 정의하고 속성을 식별자 "0x12"에 바인딩합니다. 이것은 ID를 수신했음을 나타냅니다.
sotGrp_ON_LIN_TXS=LIN 송신 이벤트 그룹에는 모든 정의된 LIN 메시지 송신 성공 콜백 함수가 포함되어 있습니다.<BR>콜백 방법은 다음과 같습니다：<BR>[1] 그룹 내에서 "OnTx12"라는 콜백 함수를 정의하고 속성을 식별자 "0x12"에 바인딩합니다. 이것은 성공적으로 메시지를 전송한 것을 나타냅니다.
sotGrp_ON_LIN_PRETXS=LIN PRE- 발행 이벤트 그룹에는 백백 기능을 보내기 전에 정의 된 모든 LIN 메시지가 포함되어 있습니다. <br> 참고 :이 기능은 TSMaster에 고유하며 시스템의 각 패킷 프레임은 이러한 기능에 연결될 수 있습니다. <br> 패킷이나 프레임 유형의 내용을 수정하려면이 기능을 사용하는 것이 매우 유용합니다. <br>이 기능의 개입이 매우 높기 때문에 사용할 때 데이터를 식별하고 보호하는 데주의를 기울이십시오. <br> 사용 백 메서드는 다음과 같습니다. <br> [1] 콜백 함수 이름 "OnPretx12"및 속성 바인딩 로고 "0x12", <br>
sotGrp_ON_VAR_CHANGES=가변 변경 이벤트 그룹에는 모든 정의 된 변수 변경 함수가 포함됩니다. <br> 예를 들어, 변수 "v1"메소드 에센스로 수정 된 후 <br>이 콜백 함수를 사용 하여이 방법은 다음과 같습니다. <br> [1] 트리의 왼쪽 트리 뷰의 "변수"영역은이 지구에서 "v1"<br> [2]와 같은 변수를 보여줍니다. 가변 변경 이벤트 선언 <br <br <br> [3]이 이벤트의 "변수"속성과 "v1"<br> [4] "v1"변경 후에 가능한 처리 로직을 작성합니다. 권리.
sotGrp_ON_TIMERS=타이머 이벤트 그룹에는 정의 된 모든 타이머 콜백 기능이 포함되어 있습니다. <br> 타이머 콜백 함수 사용 다음 예를 참조하십시오. <br> [1] 10ms의 왼쪽의 "타이머"그룹의 "Tim1"<br> [2]와 같은 타이머를 정의하십시오. 이 그룹에서 타이머 콜백 함수 "ontim1"을 정의하고 "tim1.start ();"메소드 전 앞에 정의 된 타이머와 연결하여 타이머 콜백을 시작합니다. [5] 타이머 콜백을 시작합니다. "OnTIM1"함수는 전에 정의되었습니다
sotGrp_ON_STARTS=시작 이벤트 그룹에는 모든 정의 된 스크립트 시작 기능이 포함되어 있습니다. <br> 여러 시작 콜백이 정의되면 시스템은 순서 순서대로 이러한 콜백 기능을 실행합니다. <br> 참고 : 시작 -복구 기능에서는 타이밍 이벤트 나 패킷백 이벤트와 같은 이벤트가 트리거되지 않습니다. <br> 일회용 자동화 테스트를 수행하려면 테스트 코드를 단계 함수로 이동하고 마지막으로 단계 함수 끝에서 "app.termiinate_application ()"을 호출하십시오.
sotGrp_ON_STOPS=정지 이벤트 그룹에는 정의 된 모든 스크립트 중지 콜백 함수가 포함되어 있습니다. <br> 다중 정지 콜백이 정의되면 시스템은 순서 순서대로 이러한 콜백 함수를 실행합니다. <br> 참고 : 콜백 함수를 중지 할 때는 타이밍 이벤트 나 패킷 백 이벤트와 같은 이벤트가 트리거되지 않습니다.
sotGrp_ON_SHORTCUTS=단축키 그룹에는 모든 정의된 키 이벤트 콜백 함수가 포함되어 있습니다.<BR>키 이벤트를 사용하는 방법은 다음과 같습니다：<BR>[1] "OnKeyA"와 같이 키 이벤트를 정의하고 A 키를 누르면 이벤트가 트리거되도록 합니다.<BR>[2] 단축키 속성에서 키보드의 "A" 키를 누르면이 이벤트가 A 키와 관련됩니다.<BR>[3] 이벤트 콜백 함수에 처리 코드를 작성하고 프로그램이 시작될 때마다 A 키를 누르면 작성한 코드가 트리거됩니다.
sotGrp_FUNCS=사용자 정의 기능 그룹에는 모든 사용자 정의 함수의 사용자 정의가 포함되어 있습니다. <br> 사용자 정의 기능을 사용하여 다음 예제를 참조하십시오. <br> [1]이 그룹의 사용자 정의 기능을 정의하고 "func1"<br> [2] "Const S32 A, Const S32 B"와 같은 함수 속성에서 두 개의 매개 변수를 설정 코드의 코드 중 "R"로 전화하십시오.
sotItm_ALL_SRC=이 노드에는이 애플릿의 최종 소스 코드가 포함되어 있습니다. <br>이 소스 코드는 읽습니다. 컴파일 프로세스에 오류가 있으면 오류 줄 이이 파일에 위치 할 수 있습니다. <br> 컴파일 오류 문제를 해결하려면 먼저이 파일을 열면 오류 컨텍스트를 확인하고 <br> 해당 이벤트 처리 기능으로 전환하여 오류를 수정하고 다시 컴파일하십시오.
sotItm_GLOBAL_DEF=이 노드에는 모든 글로벌 변수 및 선언이 포함되어 있으며 "#include <xxx>"또는 "S32 vvar1;"등의 전체 코드 앞면에 나타납니다.
sotItm_TSMASTER_HEADER=이 노드에는 TSMaster 애플릿, 명령문 및 기타 내용 <br>이 헤더 파일을 통해 "TCAN", "PCAN"등과 같은 다양한 기호의 정의 내용을 찾을 수 있습니다.
sotItm_STEP_FUNC=단계 함수는 ECU 노드의 사이클 작업을 시뮬레이션합니다.이 노드는 시스템 순환 <br> 이중 -클릭 으로이 노드를 클릭하면 속성 편집기를 열 수 있습니다.
sotItm_DB_HEADER=이 노드는로드 된 DBC 또는 LDF 파일에 정의 된 모든 패널과 신호가 포함되어 있습니다. <br> 데이터베이스 작동의 캔 신호를 예로 들어 다음 단계를 수행 할 수 있습니다. <br> [1] 특정 특정로드 특정 TSMASTER로드 특정 DBC 파일로드 <br> [2]이 노드로 전환하면 모든 메시지와 신호의 모든 C 코드 정의가 생성되었음을 알 수 있습니다 <br> [3] "기능"페이지로 전환합니다. 오른쪽에는 아래 데이터베이스에 메시지가 표시됩니다 <br> [4] 오른쪽 -"configure_1"과 같은 메시지의 프레임을 클릭하고 "스크립트에 추가"<br>을 선택합니다. 이 메시지는 현재 스크립트 "" "" ""구성 "채널 1의 명령문을"구성 "합니다. init (); configure_1의 초기화 함수 "<br>이 라인 코드를 처음으로"configure_1 "을 사용해야하는 곳 으로이 줄 코드를 잘라야합니다. <br> [6]. "FL_SPEED"신호 : 결과
sotItm_Documentation=이 노드는이 애플릿에 대한 문서 텍스트를 작성할 수 있습니다 <br>이 애플릿에서 만든 다음 문서와 같은이 애플릿의 알고리즘을 설명하고 설명 할 수 있습니다. <br> [1] "속성"설정 - "프로그램 설정" - "프로그램 이름"<br> [2]이 애플릿에 이벤트를 추가하거나 "단계 함수"<br> [3] 코드를 실행하려면 F9를 눌러 코드를 실행합니다.
sotItm_TEST_HEADER=이 노드에는 애플릿의 모든 매개 변수의 정의가 포함됩니다.
